// Header.js
import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import '../../Header.css';
import logoImage from '../logo.png';

const Header = () => {
  
  

  return (
    <div className="header-container">
      <div className="menu">
        <div className="logo">
                      <img src={logoImage} alt="logo-EMS" />
        <p>EMS</p></div>
        </div>
      </div>
  );
};

export default Header;
